import React, { useState, useEffect } from 'react';
import axios from 'axios';

function WelcomePage() {
  const [welcomeMessage, setWelcomeMessage] = useState('');

  useEffect(() => {
    axios.get('http://localhost:8000/welcome')
      .then(response => {
        console.log("response: ", response);
        setWelcomeMessage(response.data.message); // Assuming the message is in response.data.message
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  // Placeholder functions for handling button clicks
  const handleLoginClick = () => {
    console.log("Login button clicked");
    // Here you might want to navigate to a login page or show a login modal
  };

  const handleRegisterClick = () => {
    console.log("Register button clicked");
    // Similarly, navigate to a registration page or show a registration form
  };

  return (
    <div>
      <h1>Welcome!</h1>
      <p>{welcomeMessage}</p>
      <button onClick={handleLoginClick}>Login</button>
      <button onClick={handleRegisterClick}>Register</button>
    </div>
  );
}

export default WelcomePage;
